import axios from "axios"


export const fetchAuthData=()=>{
    return (dispatch)=>{
        axios.post("http://localhost:9372/user/uye-ol")
        .then((response)=>{
            dispatch({type:"auth",payload:response.data})
        })
        .catch((error)=>{
            console.error('Error fetching data:', error);

        })
    }
}
